import React, { useState } from "react";
import reactDom from "react-dom";
import Modal from "react-bootstrap/Modal";
import prevButton from "./assets/button-prev.png";
import nextButton from "./assets/button-next.png";
import Button from "react-bootstrap/Button";
import content01 from "./assets/image-content-01.jpg";
import content02 from "./assets/image-content-02.jpg";
import content03 from "./assets/image-content-03.jpg";
import CustomButton from "./customButton";

export default function CustomModal(props) {
  const { id, img } = props;
  const [modalShow, setModalShow] = useState(null);

  return (
    <Modal
      show={modalShow}
      onHide={() => setModalShow(false)}
      {...props}
      size="md"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header>
        <Modal.Title id="contained-modal-title-vcenter"></Modal.Title>
      </Modal.Header>

      <Modal.Body id={id}>
        <h4></h4>

        <img src={img} alt={id} />
      </Modal.Body>
      <Modal.Footer></Modal.Footer>
    </Modal>
  );
}
